import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {id:'e1',title:'El1'},
    {id:'e2',title:'El2'},
]

function EventsPage(){
    return <>
        <h1>EventPage</h1>
        <ul>
            {DUMMY_EVENTS.map(event => <li key={event.id}><Link to={event.id}>{event.title}</Link></li>)}
        </ul>
    </>
}

export default EventsPage;
